class CABAL_POOL_DATA : public Singleton<CABAL_POOL_DATA>
{
public:
	template <typename T>
	std::shared_ptr<std::vector<T*>> GetCabalPoolList(CABALVECTORPOOL* pool)
	{
		auto listData = std::make_shared<std::vector<T*>>();

		if (!pool->begin || !pool->end)
			return listData;

		CABALPOOL* it_begin = pool->begin;
		CABALPOOL* it_end = pool->end;

		// C?ia segura do ponteiro it_begin
		CABALPOOL* current = it_begin;

		if ((INT64)pool != (INT64)it_begin)
		{
			while (true)
			{
				listData->push_back(reinterpret_cast<T*>(&current->_data));

				if (current == it_end && current)
					break;

				current = current->next;
			}
		}
		return listData;
	}
};

