struct Resistance
{
	struct ResistanceElem
	{
		int value;
		int immunity;
		void IncValue(const int delta)
		{
			if (delta == 100)
			{
				IncImmunity();
			}
			else
			{
				value += delta;
			}
		}
		void DecValue(const int delta)
		{
			if (delta == 100)
			{
				DecImmunity();
			}
			else
			{
				value -= delta;
			}
		}
		void IncImmunity()
		{
			++immunity;
		}
		void DecImmunity()
		{
			if (immunity > 0)
			{
				--immunity;
			}
		}
		bool HasImmunity() const { return immunity > 0; }
		ResistanceElem()
			: value(0), immunity(0)
		{
		}
	};
	ResistanceElem bfxBlow;
	ResistanceElem bfxDown;
	ResistanceElem bfxStun;
	ResistanceElem sleep;
	ResistanceElem dontMove;
	ResistanceElem criRate;
	ResistanceElem criDmg;
	ResistanceElem ampRes;
};

