typedef struct ITEM_OPTION
{
	struct NORMAL_SLOTS
	{
		BYTE option : 4;
		BYTE rareNum : 4; // (Potencia do slot = rareNum % 4) -> craft = rareNum & 7

		bool IsCraft()
		{
			auto slot = *(WORD*)this & 0x80;
			return slot == 0x80 ? true : false;
		}
		bool IsSlot()
		{
			auto slot = *(WORD*)this & 0x80;
			return slot == 0x80 ? false : true;
		}
		int SlotLevel()
		{
			return IsSlot() ? (rareNum % 4) : 0;
		}
		int CraftLevel()
		{
			return IsCraft() ? (rareNum & 7) : 0;
		}
		int GetRowOpt() const
		{
			return option;
		}
	};
	NORMAL_SLOTS sNormalSlots[3];
	BYTE slotOption : 4;
	BYTE _slotCount : 4;

	ITEM_OPTION()
	{
	};

	ITEM_OPTION(DWORD value) { *(DWORD*)this = value; }

	//METHODS
	DWORD get() { return *(DWORD*)this; }
	DWORD GetQSTSLevel() { return *(DWORD*)this / 0x80; }
	DWORD GetQSTSCount() { return *(DWORD*)this % 0x80; }

	void set(DWORD value) { *(DWORD*)this = value; }
	DWORD decrement(int value) { return *(DWORD*)this -= value; }
	DWORD increment(int value) { return *(DWORD*)this += value; }
	void RemoverAllCraft()
	{
		//trata os slots normais
		for (int i = 0; i < 3; i++)
		{
			//remove o craft do item
			if (sNormalSlots[i].rareNum > 8)
			{
				sNormalSlots[i].option = 0;
				sNormalSlots[i].rareNum = 0;
			}

			//passa as informa寤es dos slots para o inicio do slot
			if (sNormalSlots[i].option == 0 && i < 2)
			{
				//s?passa os ids pra frente caso seja slot, caso contr?io tamb? limpa
				if (sNormalSlots[i + 1].rareNum < 9)
				{
					sNormalSlots[i] = sNormalSlots[i + 1];
					sNormalSlots[i + 1] = { 0,0 };
				}
			}
		}

		//soluciona o caso de item com 1 slot e 3 crafts
		if (slotOption)
		{
			for (auto& it : sNormalSlots)
			{
				if (it.option == 0)
				{
					//passa do slot inv?ido para um slot sem uso

					it.option = slotOption; //ocupa o slot livre
					it.rareNum = 1; //define o rarenum como 1

					//limpa a option no slot invalido
					slotOption = 0;
					break;
				}
			}
		}
	}
	void RemoveAllSlot()
	{
		for (int i = 0; i < 3; i++)
		{
			//remove o craft do item
			if (sNormalSlots[i].rareNum < 8)
			{
				sNormalSlots[i].option = 0;
				sNormalSlots[i].rareNum = 0;
			}
		}
		//remove o slot bugado quando tem 3 crafts
		if (slotOption)
			slotOption = 0;
	}
	int SlotCount() const
	{
		int result = 0;
		for (int i = 0; i < 3; i++)
		{
			if (sNormalSlots[i].rareNum && sNormalSlots[i].rareNum < 8)
			{
				result += sNormalSlots[i].rareNum % 4;
			}
		}

		if (slotOption)
			result++;

		return result;
	}
	void RemoveSelectedSlot(int slot)
	{
		if (slot < 1 || slot > 4)
		{
			//printf("O slot digitado nao existe.\n");
			return;
		}

		BYTE tmpSlot = slot - 1;

		if (!sNormalSlots[tmpSlot].option)
		{
			//printf("O slot selecionado ja esta vazio.\n");
			return;
		}

		if (sNormalSlots[tmpSlot].rareNum > 9)
		{
			//printf("Voce nao pode remover um slot de craft.\n");
			return;
		}

		//limpa os slots normais
		if (tmpSlot < 3)
		{
			if (sNormalSlots[tmpSlot].rareNum > 1)
			{
				sNormalSlots[tmpSlot].rareNum -= 1; //decrementa o slot em 1
				//printf("decrementado 1 slot\n");
			}
			else
			{
				sNormalSlots[tmpSlot].option = 0;
				sNormalSlots[tmpSlot].rareNum = 0;
			}
		}
		else
		{
			slotOption = 0;
		}


		for (int i = 0; i < 3; i++)
		{
			//passa as informa寤es dos slots para o inicio do slot
			if (sNormalSlots[i].option == 0 && i < 2)
			{
				//s?passa os ids pra frente caso seja slot, caso contr?io tamb? limpa
				if (sNormalSlots[i + 1].rareNum < 9)
				{
					sNormalSlots[i] = sNormalSlots[i + 1];
					sNormalSlots[i + 1] = { 0,0 };
				}
			}
		}

		//soluciona o caso de item com 1 slot e 3 crafts
		if (slotOption)
		{
			for (auto& it : sNormalSlots)
			{
				if (it.option == 0)
				{
					//passa do slot inv?ido para um slot sem uso

					it.option = slotOption; //ocupa o slot livre
					it.rareNum = 1; //define o rarenum como 1

					//limpa a option no slot invalido
					slotOption = 0;
					break;
				}
			}
		}
	}
}ITEM_OPTION;

